import React, { lazy } from 'react';
import { Switch, Route } from 'react-router-dom';
import { useRouteMatch } from 'react-router-dom/cjs/react-router-dom.min';

const AddSubAdmin = lazy(() => import('../../container/subAdmin/AddSubAdmin'));
const ListSubAdmin = lazy(() => import('../../container/subAdmin/ListSubAdmin'));

const News = () => {
  const { path } = useRouteMatch();
  return (
    <Switch>
      <Route exact path={`${path}/addSubAdmin`} component={AddSubAdmin} />
      <Route exact path={`${path}/listSubAdmin`} component={ListSubAdmin} />
      <Route exact path={`${path}/editAdvertisement/:adsId`} component={EditAdvertisement} />

    </Switch>
  );
};

export default News;
